// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./../Pool/StonePool.sol";
import "./../Pool/AvatarPool.sol";
import "./../Pool/WearablePool.sol";


contract Actions is Ownable {

    address private AvatarPoolAddress; 
    address private StonePoolAddress; 
    address private WearablePoolAddress; 


    constructor (
        address _AvatarPoolAddress,
        address _StonePoolAddress,
        address _WearablePoolAddress
    ) {
        
        AvatarPoolAddress = _AvatarPoolAddress;
        StonePoolAddress = _StonePoolAddress;
        WearablePoolAddress = _WearablePoolAddress;
    }



    /**
        SET & GET ADDRESS
     */
    function getAvatarPoolAddress() public view returns (address) { return AvatarPoolAddress; }
    function setAvatarPoolAddress(address _AvatarPoolAddress) public onlyOwner { AvatarPoolAddress = _AvatarPoolAddress; }

    function getStonePoolAddress() public view returns (address) { return StonePoolAddress; }
    function setStonePoolAddress(address _StonePoolAddress) public onlyOwner { StonePoolAddress = _StonePoolAddress; }

    function getWearablePoolAddress() public view returns (address) { return WearablePoolAddress; }
    function setWearablePoolAddress(address _WearablePoolAddress) public onlyOwner { WearablePoolAddress = _WearablePoolAddress; }



    /**
        FUNCTIONS FOR MAKE ACTIONS
     */
    function setStone(uint256 avatarID, uint256 stoneID, uint256 stoneSlot) public 
        { internalStone(avatarID, stoneID, stoneSlot, true); }

    function setWearables(uint256 avatarID, uint256 wearableID, uint256 wearableSlot) public 
        { internalWearables(avatarID, wearableID, wearableSlot, true); }


    function removeStone(uint256 avatarID, uint256 stoneID, uint256 stoneSlot) public 
        { internalStone(avatarID, stoneID, stoneSlot, false); }

    function removeWearables(uint256 avatarID, uint256 wearableID, uint256 wearableSlot) public 
        { internalWearables(avatarID, wearableID, wearableSlot, false); }


    function getStoneInfo(uint256 avatarID, uint256 stoneSlot) public view returns (uint256) 
        { return AvatarPool(AvatarPoolAddress).getAvatarInfo(avatarID).stone[stoneSlot]; }
    
    function getWearableInfo(uint256 avatarID, uint256 wearableSlot) public view returns (uint256) 
        { return AvatarPool(AvatarPoolAddress).getAvatarInfo(avatarID).wearables[wearableSlot]; }





    /**
        INTERNAL 
     */
    function internalStone(uint256 avatarID, uint256 stoneID, uint256 stoneSlot, bool boolSet) internal {
        // TODO: Check the slot type. If the slot is predispoted to get this NFT
        
        // Check avatar condiction
        require(AvatarPool(AvatarPoolAddress).ownerOfNFT(avatarID), "You are not the avatar owner");
        require(AvatarPool(AvatarPoolAddress).getAvatarInfo(avatarID).stone[stoneSlot] == (boolSet ? 0 : stoneID), "The slot has already been filled");

        // Check stone condiction
        require(StonePool(StonePoolAddress).ownerOfNFT(stoneID), "You are not the stone owner");
        
        // Set datas to avatar
        AvatarPool(AvatarPoolAddress).setAvatarInfo(avatarID, false, boolSet ? stoneID : 0, stoneSlot, 0, 0);
    }

    function internalWearables(uint256 avatarID, uint256 wearableID, uint256 wearableSlot, bool boolSet) internal {
        // TODO: Check the slot type. If the slot is predispoted to get this NFT

        // Check avatar condiction
        require(AvatarPool(AvatarPoolAddress).ownerOfNFT(avatarID), "You are not the avatar owner");
        require(AvatarPool(AvatarPoolAddress).getAvatarInfo(avatarID).wearables[wearableSlot] == (boolSet ? 0 : wearableID), "The slot has already been filled");

        // Check stone condiction
        require(WearablePool(WearablePoolAddress).ownerOfNFT(wearableID), "You are not the wearable owner");
        
        // Set datas to avatar
        AvatarPool(AvatarPoolAddress).setAvatarInfo(avatarID, false, 0, 0, boolSet ? wearableID : 0, wearableSlot);
    }

}
